    int? price,
    String? currencyCode,
    List<Images>? images,
    List<Related>? related,
  }) =>
      Data(
        pid: pid ?? _pid,
        vid: vid ?? _vid,
        title: title ?? _title,
        fav: fav ?? _fav,
        catagory: catagory ?? _catagory,
        body: body ?? _body,
